import React from 'react';
import {
  BrowserRouter,
  Switch,
  Route
  } from 'react-router-dom';
import {
  AppBar,
  Button,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  Toolbar
  } from '@material-ui/core';

import App from './App';

const StyledButton = withStyles({
  root: {
    color: "white"
  }
})(Button);

function MenuBar(){
  return(
    <BrowserRouter>
      <AppBar color="primary" position="sticky">
        <Toolbar>
          <StyledButton component={Link} to="/">Demo App</StyledButton>
        </Toolbar>
      </AppBar>
      <Switch>
        <Route path='/'>
          <App />
        </Route>
      </Switch>
    </BrowserRouter>
  );
};

export default MenuBar;
